import React from 'react'

import Title from './../title'
import './styles.css'

const WhatTheySay = () => {
    
    function onWheel (event) {
        if(event.deltaY > 0){
            event.target.scrollBy(500, 0)
        }else{
            event.target.scrollBy(-500, 0)
        }
    }

    return (
        <>
            <div className="what-they-say" id="depositions">
                <div className="container">
                    <div className="row">
                        <Title title="O que dizem sobre mim?" />
                    </div>

                    <div className="row">
                        <div className="comments" onWheel={ (event) => onWheel(event)}>
                            <div className="comment">Meu depoimento é um teste que indicar como é que fica o layout</div>
                            <div className="comment">teste</div>
                            <div className="comment">teste</div>
                            <div className="comment">teste</div>
                        </div>
                    </div>
                </div>
            </div>
        </>
    )
}
export default WhatTheySay
